description:
Fantasy DamselsFD - Sep 25, 2012 - Cameron Canada

MP4 + Pics

Cameron's one of those &quot;problem employees&quot;. You know the type. Always late. Always a fucking excuse. She's uttered her last excuse to her fed up boss on this day however. She claims she wants her job. She pleads to keep it and suddenly her bluff is called. The ultimatum from her boss is simple...strip bare or hit the bricks. Stunned, Cameron strips down and finds herself bound tightly. Despite her binds, she somehow struggles to her feet and makes it to the door only to find it locked. Her escape attempt infuriates her employer even more and sets the stage for what will surely be a attitude correction session to remember

